// SPDX-License-Identifier: MIT
//Cryptoloteria Contracts (last updated v1.0)
pragma solidity ^0.8.5;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./ConfigurationNFT.sol";


/**
 * @dev _Available since v1.0
 */
contract ExchangeNFT is ConfigurationNFT {
    event Initialize (
        address  holder,
        address oracle,
        uint256 cancelFee,
        uint256 acceptFee,
        uint256 fee,
        bool isNative
    );

    struct Offer {
        uint256 timeLive;
        uint256 createdAt;
        address from;
        uint256 amountOffer;
        address crypto;
        bool is721;
        bool status;
    }

    struct Bid {
        uint256 createdAt;
        address from;
        uint256 amount;
        address crypto;
    }


    event Bought (
        address collection, 
        address newOwner,
        uint256 tokenId,
        address crypto,
        uint256 price,
        bool isNative
    );

    event HigherBid (
        address owner, 
        address collection,
        uint256 tokenId,
        address crypto,
        uint256 amount
    );


    event AuctionFinish (
        address winner, 
        address collection,
        uint256 tokenId,
        address crypto,
        uint256 amount
    );



    mapping (address =>  mapping (uint256 => mapping (address => Offer))) internal offers;
    mapping (address =>  mapping (uint256 => mapping (address => Bid))) internal bids;

    constructor () {
        pause();
    }
    /**
    * NOTE: This ins de method to start to use this contract and unpause this
    *
    * Requirements:
    * @param _acceptFee is the amount in USD
    */
    function initialize(
        address payable _holder,
        address _oracle,
        uint256 _cancelFee,
        uint256 _acceptFee,
        uint256 _fee)  public onlyOwner{
        setHolder(_holder);
        setOracle(_oracle);
        setFee(_fee);
        setCancelFee(_cancelFee);
        setAcceptFee(_acceptFee);
        unpause();
        //emit Initialize(_holder, _collection, _wrapped, _oracle, _cancelFee, _acceptFee, _fee);
    }

    function addOffer(address collection, uint256 tokenId,address crypto, uint256 amount,uint256 timeLive,bool is721) public payable returns(bool) {
        require(settings[collection][tokenId].onAuction == false);
        require(amount >= 0);
        require(cryptos[crypto].status == 1);
        require(ERC20(crypto).balanceOf(_msgSender()) >= amount);
        require(ERC20(crypto).allowance(_msgSender(),address(this)) >= amount);
        offers[collection][tokenId][_msgSender()] = Offer(timeLive, block.timestamp,_msgSender(),amount,crypto,is721,true);
        return true;
    }

    function acceptOffer(address collection, uint256 tokenId,bool is721,address offerOwner) public payable returns(bool) {
        require(settings[collection][tokenId].onAuction == false);
        require((offers[collection][tokenId][offerOwner].timeLive + offers[collection][tokenId][offerOwner].createdAt) >= block.timestamp, "Invalid offer");
        require(cryptos[offers[collection][tokenId][offerOwner].crypto].status == 1);
        require(msg.value >=  fee());
        retriveFee();
        require(ERC20(offers[collection][tokenId][offerOwner].crypto).balanceOf(offers[collection][tokenId][offerOwner].from) >= offers[collection][tokenId][offerOwner].amountOffer,"Not sufficent crypto to buy");
        require(ERC20(offers[collection][tokenId][offerOwner].crypto).allowance(offers[collection][tokenId][offerOwner].from,address(this)) >= offers[collection][tokenId][offerOwner].amountOffer,"Not sufficent crypto approved to buy");
        ERC20(offers[collection][tokenId][offerOwner].crypto).transferFrom(_msgSender(),address(this), offers[collection][tokenId][offerOwner].amountOffer);
        if(is721) {
            validate721(collection,tokenId,_msgSender());
            ERC721(collection).transferFrom(_msgSender(),offers[collection][tokenId][offerOwner].from,tokenId);
        } else {
            require(ERC1155(collection).balanceOf(_msgSender(),tokenId) > 0);
            require(ERC1155(collection).isApprovedForAll(_msgSender(), address(this)) == true);
            ERC1155(collection).safeTransferFrom(_msgSender(),offers[collection][tokenId][offerOwner].from,tokenId,1,"");
        }
        return true;
    }

    function buyNow(address collection, uint256 tokenId,address crypto,bool isNative) public payable returns(bool) {
        require(settings[collection][tokenId].onSale == true,"This nfts is not on sale");
        retriveFee();
        if (isNative) {
            require(msg.value >= (settings[collection][tokenId].price + fee()), "You dont sufficent amout to buy this nft");
            payable(settings[collection][tokenId].owner).transfer(settings[collection][tokenId].price);
        } else {
            require(msg.value >=  fee(),"You dont have sufficen amount");
            require(cryptos[crypto].status == 1,"This crypto is not available");
            uint256 price_in_usd = getPriceNFTInUSD(collection,tokenId,oracle.getAddress(),crypto);
            require(ERC20(crypto).balanceOf(_msgSender()) >= price_in_usd,"You dont have sufficent erc20");
            require(ERC20(crypto).allowance(_msgSender(),address(this)) >= price_in_usd,"You dont approve erc20");
            ERC20(crypto).transferFrom(_msgSender(),settings[collection][tokenId].owner, price_in_usd);
        }
        if(settings[collection][tokenId].is721) {
            validate721(collection,tokenId,settings[collection][tokenId].owner);
            ERC721(collection).transferFrom(settings[collection][tokenId].owner,_msgSender(),tokenId);
        } else {
            validate1155(collection,tokenId,settings[collection][tokenId].owner);
            ERC1155(collection).safeTransferFrom(settings[collection][tokenId].owner,_msgSender(),tokenId,1,"");
        }
        emit Bought(collection,_msgSender(),tokenId,crypto,settings[collection][tokenId].price,isNative);
        delete settings[collection][tokenId];
        return true;
    }

    function getPriceNFTInUSD(address collection, uint256 tokenId, address _base, address _quote) public view returns(uint256) {
        return settings[collection][tokenId].price * uint256(oracle.getDerivedPrice(_base,_quote,8)) / (10 ** 8);
    }

    function getPriceInUSD(uint256 amount, address _base, address _quote) public view returns(uint256) {
        return amount * uint256(oracle.getDerivedPrice(_base,_quote,8)) / (10 ** 8);
    }

    function bid(address collection, uint256 tokenId,address crypto, uint256 amount) public payable returns(bool){
        require(msg.value >=  fee(),"You dont have sufficent amount");
        require(cryptos[crypto].status == 1,"This crypto is not available");
        require(settings[collection][tokenId].onAuction == true,"This nft is not in auction");
        require(amount > 0,"Amount insuficent");
        retriveFee();
        if(settings[collection][tokenId].startDate == 0 && settings[collection][tokenId].lastBidAddress == address(0)) {
            uint256 price_in_usd = getPriceInUSD(amount,oracle.getAddress(),cryptos[crypto].oracle.getAddress());
            require(ERC20(crypto).balanceOf(_msgSender()) >= price_in_usd,"You dont have sufficent crypto");
            require(ERC20(crypto).allowance(_msgSender(),address(this)) >= price_in_usd,"You dont have sufficent crypto approved");
            settings[collection][tokenId].startDate  = block.timestamp;
        } else {
            require((settings[collection][tokenId].startDate + settings[collection][tokenId].timeLive) >= block.timestamp);
            address last_address = settings[collection][tokenId].lastBidAddress;
            Crypto memory oldCrypto = cryptos[bids[collection][tokenId][settings[collection][tokenId].lastBidAddress].crypto];
            uint256 last_bid_amount = getPriceInUSD(bids[collection][tokenId][last_address].amount,oracle.getAddress(),oldCrypto.oracle.getAddress());
            uint256 price_in_usd = getPriceInUSD(amount,oracle.getAddress(),cryptos[crypto].oracle.getAddress());
            require(price_in_usd > last_bid_amount,"Last bid error");
            require(ERC20(crypto).balanceOf(_msgSender()) >= amount,"You dont have sufficent crypto");
            require(ERC20(crypto).allowance(_msgSender(),address(this)) >= amount,"You dont have sufficent crypto");
        }
        bids[collection][tokenId][_msgSender()] = Bid(block.timestamp,_msgSender(),amount,crypto);
        settings[collection][tokenId].lastBidAddress = _msgSender();
        settings[collection][tokenId].allBids.push(_msgSender());
        emit HigherBid(_msgSender(),collection,tokenId,crypto,amount);
        return true;
    }

    function endAuction(address collection, uint256 tokenId)  public payable returns(bool){
        require(msg.value >=  fee(),"You dont have sufficent amount");
        require(settings[collection][tokenId].onAuction == true,"This nft is not in auction");
        retriveFee();
        address crypto = bids[collection][tokenId][settings[collection][tokenId].lastBidAddress].crypto;
        uint256 amount = bids[collection][tokenId][settings[collection][tokenId].lastBidAddress].amount;
        Bid memory _bid;
        if(ERC20(crypto).allowance(_msgSender(),address(this)) >= amount && ERC20(crypto).balanceOf( settings[collection][tokenId].lastBidAddress) >= amount) {
            _bid = bids[collection][tokenId][settings[collection][tokenId].lastBidAddress];
        } else {
            for (uint256 index = 0; index < settings[collection][tokenId].allBids.length; index++) {
                Bid memory bidFound = bids[collection][tokenId][settings[collection][tokenId].allBids[index]];
                crypto =bidFound.crypto;
                amount = bidFound.amount;
                if(ERC20(crypto).allowance(_msgSender(),address(this)) >= amount && ERC20(crypto).balanceOf(bidFound.from) >= amount) {
                    _bid = bidFound;
                }
            }
        }
        require(_bid.from != address(0));
        if(settings[collection][tokenId].is721) {
            validate721(collection,tokenId,_msgSender());
            ERC20(_bid.crypto).transferFrom(_bid.from ,_msgSender(), _bid.amount);
            ERC721(collection).safeTransferFrom(_msgSender(),_bid.from,tokenId);
        } else {
            validate1155(collection,tokenId,_msgSender());
            ERC20(_bid.crypto).transferFrom(_bid.from ,_msgSender(), _bid.amount);
            ERC1155(collection).safeTransferFrom(_msgSender(),_bid.from,tokenId,1,"");
        }
        emit AuctionFinish(_bid.from,collection,tokenId,_bid.crypto, _bid.amount);
        delete settings[collection][tokenId];
        return true;
    }

}

